import React, { Component } from 'react';
import s from './Profile.module.css';

class Profile extends Component {
    render() {
        return (
            <div className={s.profilePage}>
                <div >
                    <img src='http://novostrojka.by/upload/pic/760d0d546bed5eea4668e7e220c22d38.jpg'/>
                </div>
                <div>
                    <img src=''/>
                </div>

                <div>userName</div>
                <div>День рождения:</div>
                <div>Город:</div>
                <div>Образование:</div>
                <div>Веб сайт:</div>

            </div>

        );
    }
}

export default Profile
